import logo from "./logo.png"
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="logo img-fluid" alt="Site logo" />
        <img src={logo} className="logo img-fluid" alt="Site logo" />
        <img src={logo} className="logo img-fluid" alt="Site logo" />
      </header>
    </div>
  );
}

export default App;
